import datetime

d, m = map(int, input().split())

# datetime.weekday() returns a number between 0 and 6
# 0 is Monday, 6 is Sunday
day = datetime.date(2009, m, d).weekday()

# The days of the week are numbered 0 through 6, where 0 is Monday, 1 is Tuesday,
# and so on.
# https://docs.python.org/3/library/datetime.html#datetime.date.weekday
if day == 0:
    print("Monday")
elif day == 1:
    print("Tuesday")
elif day == 2:
    print("Wednesday")
elif day == 3:
    print("Thursday")
elif day == 4:
    print("Friday")
elif day == 5:
    print("Saturday")
elif day == 6:
    print("Sunday")

from datetime import date

def main():
    d, m = map(int, input().split())
    print(date(2009, m, d).strftime("%A"))

if __name__ == '__main__':
    main()
